import React from "react";
import styled from "styled-components";
import { Link } from "react-router-dom";

const Header = (props) => {
  return (
    <React.Fragment>
      {/* <Link to="/"> */}
        <Title onClick={()=>{props.history.push("/");}}>Gaesi-pan</Title>
      {/* </Link> */}

      <Buttonset>
        <Link to="/">
          <Button>모든 포스팅</Button>
        </Link>
        <Link to="/write">
          <button style={{ width: 400, height: 40 }}>글쓰기</button>
        </Link>
        <Link to="/intro">
          <Button>소개</Button>
        </Link>
      </Buttonset>

      <hr style={{ width: 1200 }} />
    </React.Fragment>
  );
};
const Button = styled.button`
  height: 40px;
  width: 150px;
  margin: 20px;
`;
const Title = styled.h1`
  text-align: center;
  font-size: 60px;
  margin: 50px auto;
  color: black;
`;

const Buttonset = styled.div`
  text-align: center;
  margin: 0 auto;
`;
export default Header;
